import React from 'react'
import {Text} from '../../atoms'

const Social = ({items, props}) => {

    return (
        <StyledSocial>
            {
                items.map(item => (
                    <Text href={item.url} key={item.id}>{item.title}</Text>
                ))
            }
        </StyledSocial>
    )
}

export default Social
